import TopNavBar from '../TopNavBar';
import React, { Component } from "react";
//import AddEmployee from "./Components/AddEmployee";
import { Route, BrowserRouter as Router } from "react-router-dom";
//import Table from "./Components/Table";
//import App from './App';
import background from '../charitybackground.jfif';
import ReactDOM from 'react-dom';
import Recipients from "../Components/Recipients";
import HomePageCharities from '../Components/HomePageCharities';
import { Container } from 'react-bootstrap';
import Footer from '../Footer';



class HomeAdmin extends React.Component {



    //componentDidMount(props){
        //console.log("username",this.props.homeadmin.state.username);}

        constructor(props) {
            super(props);
            console.log(this.props.data.username)
            this.state = {
                currentPage: "HomePageAdmin",
                username: this.props.data.username
            };
          }

          

    render() {
        return (
            <>
                <TopNavBar data={this.state}/>
                <h1>Welcome you have been logged in {this.state.username} </h1>
                <Footer />
            </>
        )
    }
}




export default HomeAdmin;
